      <img src={Logo2} alt="Logo" />
      {/* <ThemeDiv f="row" w="340px" a="center" g="10px">

          <button>Home</button>

          <button>Login</button>

          <button>Cadastrar escola</button>

          <button>Eventos</button>

      </ThemeDiv> */}
    </ThemeHeader>
  );
};

export default HeaderHome;
